import { Route } from 'react-router-dom';


function Home(){

    return (
        <div>
    <input type='text' placeholder='Runner name'></input>
    <input type='submit' value='Reseach' onClick={() => {
        <Route path='/' element={NewRunner}></Route>
    }}/>

        </div>
    )

}

export default Home;
